            { self.state.guests == 'solo' ? <h2 className="thanks-message">Thanks, see you there. We‚Äôll seat you at the rando table.</h2> : ''}
            { self.state.guests == 'plus1' ? <h2 className="thanks-message">Thanks, see you and your +1 there.</h2> : ''}
